column8:
T10 T16 1W級 ハイパワーSMDバルブ 2個セット<br>
カラー ホワイト/ブルー/レッドより選択頂けます<br>
メール便限定で送料無料<br>
T10/16 ウェッジタイプ シングル球<br>
1W級の明るさなので、従来のバルブと比較にならない程明るくなります。<br>
アルミヒートシンク採用により、耐熱性が大幅に向上しました。<br>
広角照射タイプになります。<br>
ナンバー灯 ポジション灯 バックランプ等と取り付け箇所はアイディア次第です。<br>
LEDは消費電力が少ない特性があり、バッテリーへの負担を軽減します。<br>
※ご不明な点等がございましたら、お問い合わせください。<br>
<br>
送料・発送方法<br>
メール便発送のみとなります。<br>
通常配送(宅配便)不可。代金引換(代引)不可。<br>
【※※メール便について※※】<br>
※宅配便と違い送付先ポストへの投函となります。<br>
※代金引換でのご注文はキャンセルとさせていただきます。<br>
※発送日よりお届けまで、通常約4～5日程かかります。(一部地域を除く)<br>
※お名前、ご住所に誤りや省略がありますとお届けすること出来ません。省略せずに必ずご記入下さい。<br><br><br>


