特徴・注意事項<br>
４穴・５穴に対応しています。<br>
上記記載の車種でも、オプション・グレードにより取り付け出来ない場合も御座います。<BR>
※輸入品のため細かい傷が入っている場合がございます。ご了承のうえご注文をお願い致します。
<br><br>

送料<br>
全国一律864円、北海道1404円、沖縄・離島は別途必要となります 。<br>
      直接引取り・宅配業者の指定・定型外発送はお断りいたします。<BR>
      商品は、輸入品になりますので僅かな傷や汚れが付着する場合がございます予めご了承ください。<BR>
      初期不良の場合、交換対応とさせて頂きます。<BR>
      初期不良対応期間は、商品到着後1週間とさせて頂きます。<BR>
      弊社では、商品取り付け等のサポートは致しかねますので予めご了承ください。
<BR>その他詳しくは会社概要をお読みください。<BR><br><br><br>


